import {Mongo} from "meteor/mongo";
import {Meteor} from "meteor/meteor";


export const Users = new Mongo.Collection("Users");


if (Meteor.isServer) {
    Meteor.publish("Users", () => {
        return Users.find({});
    });
}

Meteor.methods({
    "users.changeSelected"(id) {
        const res = Users.findOne({_id: id});
        let selected = res.selected;
        selected = !selected;
        Users.update(res._id, {
            $set: {selected: selected},
        });
    },
    "users.initialInsert"() {
        Users.remove({});
        data.forEach((item) => {
            Users.insert(
                item
            );
        })
    },
    "users.clear"() {
        Users.remove({});
    }
});

